import React from 'react'
import { Col, Row } from 'react-bootstrap'
import products from '../../products'

const LandingPage = () => {
    return (
        <>
        <h1>Latest Products</h1>
        <Row>
            {products.map(product => (
                <Col sm={12} md={6} lg={3} xl={3}>
                    <h3>{product.name}</h3>

                </Col>

            )


            )}
        </Row>

        </>
    )
}

export default LandingPage
